import React, { useEffect } from 'react';
import client1 from '../images/Asad.jpeg';
import 'owl.carousel';

const Clients = () => {
  useEffect(() => {
    $(document).ready(function () {
      $('.clients-carousel').owlCarousel({
        items: 3,
        loop: true,
        margin: 20,
        dots: true,
        responsive: {
          0: {
            items: 1,
          },
          600: {
            items: 2,
          },
          1000: {
            items: 3,
          },
        },
      });
    });
  }, []);

  return (
    <div className="clients mt-100">
      <div className="container">
        <div className="section-header">
          <h2>Our Clients</h2>
          <p>We don't just build software; we build your business.</p>
        </div>
        <div className="clients-carousel-container">
          <div className="owl-carousel clients-carousel">
            <div className="client-item">
              <img src={client1} alt="Client 1" />
            </div>
            <div className="client-item">
              <img src={client1} alt="Client 2" />
            </div>
            {/* Add more client items as needed */}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Clients;
